import "./home.css";
import { useEffect } from "react";
import { Route, Routes } from "react-router-dom";
import Sidebar from "../../components/sidebar/sidebar";
import Transactions from "../../components/transaction/transaction";
import NewHotel from "../../components/newHotel/newHotel";
import Hotel from "../../components/hotels/hotels";
import Users from "../../components/users/users";
import Rooms from "../../components/rooms/rooms";
import NewRoom from "../../components/newRoom/newRooms";

const Home = ({ setAdmin }) => {
  useEffect(() => {}, []);
  return (
    <div className="container" style={{ maxWidth: "1500px" }}>
      <h1 className="admin-page">Admin page</h1>
      <div className="row ">
        <Sidebar setAdmin={setAdmin} />
        <Routes>
          <Route exact path="/" element={<Transactions full={false} />} />
          <Route path="/hotel" element={<Hotel />} />
          <Route path="/users" element={<Users />} />
          <Route path="/rooms" element={<Rooms />} />
          <Route path="/transactions" element={<Transactions full={true} />} />
          <Route path="/new-hotel" element={<NewHotel addCheck={true} />} />
          <Route
            path="/edit-hotel/:idHotel"
            element={<NewHotel addCheck={false} />}
          />
          <Route path="/new-room" element={<NewRoom />} />
        </Routes>
      </div>
    </div>
  );
};

export default Home;
